import React, { useEffect } from 'react';
import { Bar } from 'react-chartjs-2';
import {
	Chart as ChartJS,
	CategoryScale,
	LinearScale,
	BarElement,
	Title,
	Tooltip,
	Legend,
} from 'chart.js';
import './CurrentPrice.css';

ChartJS.register(
	CategoryScale,
	LinearScale,
	BarElement,
	Title,
	Tooltip,
	Legend
);

const TodaysPrices = ({ TodaysPrices }) => {
	return (
		<div className='todaysPrices'>
			<h1>Todays Prices</h1>
			<Bar
				data={{
					labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
					datasets: [
						{
							label: '# of Votes',
							data: [12, 19, 3, 5, 2, 3],
						},
					],
				}}
				height={400}
				width={800}
				options={{ maintainAspectRatio: true }}
			/>
		</div>
	);
};

export default TodaysPrices;
